        logo.y = 720 - 25;
        self.addChild(logo, 0);

        var that = this;
        var listener1 = cc.EventListener.create({
            event: cc.EventListener.TOUCH_ONE_BY_ONE,
            swallowTouches: true,                       // 设置是否吞没事件，在 onTouchBegan 方法返回 true 时吞没
            onTouchBegan: function (touch, event) {     //实现 onTouchBegan 事件回调函数

                var target = event.getCurrentTarget();
                var point = target.convertToNodeSpace(touch.getLocation());
                var s = target.getContentSize();
                var rect = cc.rect(0, 0, s.width, s.height);
                if(cc.rectContainsPoint(rect, point)) {

                    close_game();

                    return true;
                }
            }
        });

        cc.eventManager.addListener(listener1, logo);


